import {StyleSheet, Text} from 'react-native'

export default function App() {
    return (
        <>
            <Text accessibilityRole="header" style={styles.text}>
                React Native for Web & Next.js
            </Text>
            <Text accessibilityRole="header" style={styles.text}>
                React Native for Web & Next.js
            </Text><Text accessibilityRole="header" style={styles.text}>
            React Native for Web & Next.js
        </Text>

        </>
    )
}

const styles = StyleSheet.create({
    container: {
        alignItems: 'center',
        flexGrow: 1,
        justifyContent: 'center',
    },
    link: {
        color: 'blue',
    },
    textContainer: {
        alignItems: 'center',
        marginTop: 16,
    },
    text: {
        alignItems: 'center',
        fontSize: 24,
        marginBottom: 24,
    },
})
